        <div className="w-[400px] h-full">
          <img
            src={aboutImg}
            alt=""
            className="object-cover bg-gray-700 rounded-xl h-[300px] filter grayscale brightness-50"
          />
        </div>
      </div>

      <div>
        <div className="p-2">
          <div className="text-gray-300 my-3">
            <h3 className="text-4xl font-semibold mb-5">
              About <span className="primary-text"> Me</span>
            </h3>
            <p className="text-justify leading-3 w-11/12 mx auto">dfsdfsdssddggdsgsdgsdgdssdg</p>
          </div>
        </div>
      </div>
    </div>
  );
};

